	(448,'Maya Lin','To fly, we have to have resistance.',54,'2019-03-16 04:40:51',1552707651,-13.512,80.9022),
	(449,'Elbert Hubbard','The final proof of greatness lies in being able to endure criticism without resentment.',139,'2019-06-13 11:01:50',1560416510,-83.3127,97.82369999999999),
	(450,'Buddha','However many holy words you read, However many you speak, What good will they do you If you do not act on upon them?',166,'2019-07-07 23:27:47',1562534867,-31.443500000000004,72.16709999999999),
	(451,'Thomas Carlyle','Do not be embarrassed by your mistakes. Nothing can teach us better than our understanding of them. This is one of the best ways of self-education.',48,'2019-03-06 22:39:21',1551908361,83.3524,118.3511),
	(452,'Grandma Moses','Life is what you make of it. Always has been, always will be.',93,'2019-04-22 10:43:41',1555922621,-61.0352,-167.1372),
	(453,'German proverb','Begin to weave and God will give you the thread.',180,'2019-07-21 22:27:30',1563740850,62.8954,83.12119999999999),
	(454,'Buddha','Three things cannot be long hidden: the sun, the moon, and the truth.',117,'2019-05-16 20:01:21',1558029681,-30.602,79.4091),
	(455,'Doug Larson','Wisdom is the reward you get for a lifetime of listening when you\'d have preferred to talk.',99,'2019-05-02 17:06:14',1556809574,-44.8642,-84.9612),
	(456,'Robert Louis Stevenson','There is no duty we so underrate as the duty of being happy. By being happy we sow anonymous benefits upon the world.',95,'2019-04-26 04:34:32',1556246072,2.0275,26.443299999999997),
	(457,'Ralph Emerson','Our distrust is very expensive.',136,'2019-06-09 22:57:17',1560113837,27.3565,158.8343),
	(458,'William Londen','To ensure good health: eat lightly, breathe deeply, live moderately, cultivate cheerfulness, and maintain an interest in life.',90,'2019-04-15 21:24:52',1555356292,-52.4766,-11.8153),
	(459,'Jim Bishop','The future is an opaque mirror. Anyone who tries to look into it sees nothing but the dim outlines of an old and worried face.',177,'2019-07-15 11:03:41',1563181421,19.607,108.40310000000001),
	(460,'Sigmund Freud','It is impossible to escape the impression that people commonly use false standards of measurement — that they seek power, success and wealth for themselves and admire them in others, and that they underestimate what is of true value in life.',143,'2019-06-10 19:39:05',1560188345,-4.1683,-104.3876),
	(461,'Dalai Lama','It is difficult to achieve a spirit of genuine cooperation as long as people remain indifferent to the feelings and happiness of others.',48,'2019-03-09 15:27:21',1552141641,88.1524,126.3511),
	(462,'Pablo Picasso','I begin with an idea and then it becomes something else.',34,'2019-02-25 12:41:43',1551094903,-18.7387,-70.3362),
	(463,'Laozi','The power of intuitive understanding will protect you from harm until the end of your days.',85,'2019-04-13 09:32:11',1555140731,79.111,161.3069),
	(464,'Cynthia Ozick','To want to be what one can be is purpose in life.',42,'2019-03-03 03:07:37',1551578857,-49.754000000000005,-31.6407),
	(465,'William Shakespeare','We know what we are, but know not what we may be.',156,'2019-06-28 15:05:10',1561727110,41.1852,9.369),
	(466,'H. Jackson Browne','Don\'t be afraid to go out on a limb. That\'s where the fruit is.',17,'2019-02-07 03:47:41',1549507661,-78.7533,88.4545),
	(467,'Mary Morrissey','You block your dream when you allow your fear to grow bigger than your faith.',188,'2019-07-29 06:02:52',1564372972,20.4791,-162.47529999999998),
	(468,'Socrates','Wisdom begins in wonder.',57,'2019-03-14 06:46:42',1552542402,75.1608,1.6324),
	(469,'Seneca','Luck is what happens when preparation meets opportunity.',42,'2019-02-28 12:43:37',1551354217,-49.054,-32.8407),
	(470,'Leo Aikman','Blessed is the person who is too busy to worry in the daytime, and too sleepy to worry at night.',122,'2019-05-26 02:39:06',1558831146,-80.2827,127.0858),
	(471,'Confucius','Wherever you go, go with all your heart.',165,'2019-07-02 20:09:35',1562090975,73.0018,83.6791),
	(472,'Amelia Earhart','The most difficult thing is the decision to act, the rest is merely tenacity. The fears are paper tigers. You can do anything you decide to do. You can act to change and control your life; and the procedure, the process is its own reward.',154,'2019-06-24 19:10:29',1561396229,32.8977,-110.2471),
	(473,'William Arthur Ward','Do more than dream: work.',126,'2019-05-25 22:02:18',1558814538,-53.7318,54.906499999999994),
	(474,'Winston Churchill','The pessimist sees difficulty in every opportunity. The optimist sees the opportunity in every difficulty.',107,'2019-05-05 12:17:26',1557051446,-44.7983,-26.2293),
	(475,'Albert Einstein','You can\'t blame gravity for falling in love.',193,'2019-08-02 12:36:37',1564742197,-71.15400000000001,96.1617),
	(476,'Buddha','Thousands of candles can be lighted from a single candle, and the life of the candle will not be shortened. Happiness never decreases by being shared.',8,'2019-01-28 20:27:32',1548703652,-12.5115,83.3789),
	(477,'Carl Jung','Without this playing with fantasy no creative work has ever yet come to birth. The debt we owe to the play of the imagination is incalculable.',138,'2019-06-09 16:29:45',1560090585,85.9962,18.262),
	(478,'Maureen Dowd','The minute you settle for less than you deserve, you get even less than you settled for.',182,'2019-07-20 18:59:15',1563641955,53.0226,-182.27360000000002),
	(479,'Anatole France','You learn to speak by speaking, to study by studying, to run by running, to work by working; in just the same way, you learn to love by loving.',186,'2019-07-23 23:05:31',1563915931,-73.247,157.3348),
	(480,'Albert Einstein','I have no special talent. I am only passionately curious.',22,'2019-02-10 00:59:31',1549756771,55.926300000000005,-159.6112),
	(481,'Henry David Thoreau','If one advances confidently in the direction of his dream, and endeavours to live the life which he had imagines, he will meet with a success unexpected in common hours.',105,'2019-05-09 19:01:56',1557421316,56.113899999999994,-81.3033),
	(482,'Vista Kelly','Snowflakes are one of natures most fragile things, but just look what they can do when they stick together.',147,'2019-06-15 09:02:45',1560582165,-87.09060000000001,-162.1881),
	(483,'Johann Wolfgang von Goethe','If you must tell me your opinions, tell me what you believe in. I have plenty of douts of my own.',64,'2019-03-30 07:44:20',1553928260,38.783500000000004,176.04590000000002),
	(484,'Byron Pulsifer','Look forward to spring as a time when you can start to see what nature has to offer once again.',181,'2019-07-19 22:08:02',1563566882,37.7999,97.8238),
	(485,'Publilius Syrus','Do not turn back when you are just at the goal.',132,'2019-05-29 18:21:31',1559146891,-36.0945,-13.7194),
	(486,'Plato','Bodily exercise, when compulsory, does no harm to the body; but knowledge which is acquired under compulsion obtains no hold on the mind.',84,'2019-04-16 17:31:19',1555428679,-52.5267,5.8567),
	(487,'Paul Tillich','Decision is a risk rooted in the courage of being free.',195,'2019-08-05 17:31:47',1565019107,45.545,-39.983700000000006),
	(488,'Thomas Jefferson','Honesty is the first chapter in the book of wisdom.',189,'2019-07-26 12:45:29',1564137929,-1.4581,-110.6188),
	(489,'Pablo Picasso','He can who thinks he can, and he can\'t who thinks he can\'t. This is an inexorable, indisputable law.',123,'2019-05-24 19:54:59',1558720499,-3.8259000000000007,169.1654),
	(490,'Confucius','Silence is a true friend who never betrays.',163,'2019-07-05 07:14:26',1562303666,-10.4996,-114.24980000000001),
	(491,'Donald Trump','As long as your going to be thinking anyway, think big.',163,'2019-07-04 16:50:26',1562251826,-12.599599999999999,-110.9498),
	(492,'Thomas Jefferson','I\'m a great believer in luck and I find the harder I work, the more I have of it.',173,'2019-07-16 16:33:14',1563287594,56.0796,-155.4936),
	(493,'Robert Schuller','Failure doesn\'t mean you are a failure it just means you haven\'t succeeded yet.',26,'2019-02-18 00:20:42',1550445642,36.278499999999994,67.4778),
	(494,'William Shakespeare','Love all, trust a few, do wrong to none.',4,'2019-01-28 20:41:23',1548704483,-89.2016,-97.3723),
	(495,'Will Rogers','If you find yourself in a hole, the first thing to do is stop digging.',122,'2019-05-25 12:15:06',1558779306,-78.5827,130.9858),
