	(497,'Richard Bach','Sooner or later, those who win are those who think they can.',177,'2019-07-12 06:15:41',1562904941,13.907,104.0031),
	(498,'Ralph Waldo Emerson','Most of the shadows of life are caused by standing in our own sunshine.',52,'2019-03-17 04:09:26',1552792166,-18.9052,38.4827),
